import React, { Component } from 'react';

class vendorCard extends Component {

  render() {
    const {name,image,likes} = this.props.vendorinfo
    return (
      <div key= {name} className="card">
        <h2>{name}</h2>
        <img src={image} alt={name} className="vendor-avatar" />
        <p>{likes} Likes </p>        
      </div>
    );
  }

}

export default vendorCard;
